INSERT INTO `File` VALUES (1,'English','','','dir',1,0,'2013-04-07 21:31:03',3,'',0,1,1,'title',NULL),(2,'HOME','','<div id=\"haveLogoTextBox\">\r\n	<a href=\"http://首頁第一圖\" val=\"4\"><img src=\"http://json.jpasia.aedew.com/upload/img/1373279998.jpg\" style=\"height: 224px; width: 1082px; margin: 50px auto 0px;\" /></a></div>\r\n<div class=\"movingBlock\" id=\"pic1\">\r\n	<div class=\"movingBlockD\">\r\n		<div class=\"movingTextBlock\">\r\n			<h1>\r\n				Headset</h1>\r\n			<p>\r\n				Tange Seiki is the leading pioneer in developing new and unique headsets such as the Zero Stack (ZS) Semi-Integrated, the I.S. Fully Integrated, the threaded headsets that look like threadless headsets and so many more.&nbsp; Whether it is the ZS, I.S., Classic Cup and Cone, threaded and tapered headsets, TANGE SEIKI sets the standard for design, invention, and quality.</p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div id=\"haveLogoTextBox\">\r\n	<a href=\"http://首頁第二圖\" val=\"9\"><img src=\"http://json.jpasia.aedew.com/upload/img/1384938839.jpg\" style=\"width: 1082px; height: 261px; margin: 0px auto;\" /></a></div>\r\n<div class=\"movingBlock\" id=\"pic2\">\r\n	<div class=\"movingBlockD\">\r\n		<div class=\"movingTextBlock\">\r\n			<h1>\r\n				Bottom Bracket</h1>\r\n			<div>\r\n				Tange Seiki brings its high quality Japanese standards and manufacturing to produce the highest quality Bottom Brackets to suit any type &ndash;Tapered Square Flats, External and ISIS Drive. &nbsp;Tange Seiki even produces steel Bottom Brackets that are designed to prevent rusting. &nbsp;These are the best Bottom Brackets you will find and Tange Seiki is honored that so many customers trust Tange Seiki.</div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div id=\"haveLogoTextBox\">\r\n	<a href=\"http://首頁第三圖\" val=\"10\"><img src=\"http://json.jpasia.aedew.com/upload/img/1374647059.jpg\" style=\"width: 1082px; height: 224px; margin: 0px auto;\" /></a></div>\r\n<div class=\"movingBlock\" id=\"pic3\">\r\n	<div class=\"movingBlockD\">\r\n		<div class=\"movingTextBlock\">\r\n			<h1>\r\n				Hubs</h1>\r\n			<div>\r\n				When Tange Seiki decides to make a product, it has to be the best. &nbsp;Tange Seiki has just introduced their new road hubs with 6 palls and very light weight. &nbsp;All 6 palls are on one spring so they all work together to immediately transfer all your power into the hub. &nbsp;NO PLAY. &nbsp;Pure Power. &nbsp;Soon Tange Seiki will be introducing it MTB range of hubs, again with 6 palls for maximum power, no play, and the greatest efficiency of any hub on the market.</div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div id=\"haveLogoTextBox\">\r\n	<a href=\"首頁第四圖\" val=\"11\"><img src=\"http://json.jpasia.aedew.com/upload/img/1373280102.jpg\" style=\"width: 1082px; height: 224px; margin: 0px auto;\" /></a></div>\r\n<div class=\"movingBlock\" id=\"pic4\">\r\n	<div class=\"movingBlockD\">\r\n		<div class=\"movingTextBlock\">\r\n			<h1>\r\n				Accessories</h1>\r\n			<div>\r\n				Tange Seiki provides a complete range of replacement parts and accessories. &nbsp;From Stainless Steel Fully Sealed Bearings to economical retainer bearings to cap sets to Bottom Bracket fixing bolts. &nbsp;If you need the very best replacement or upgrade parts for your headsets and Bottom Brackets, Tange Seiki replacement parts are the best you can find.</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n','file',1,1,'2013-04-07 21:38:19',1,'',0,1,1,'index','a:0:{}'),(3,'PRODUCTS','','','dir',1,1,'2013-04-07 22:00:09',3,'',0,1,1,'title',NULL),(4,'Headset','<p>\r\n	<img alt=\"\" src=\"http://json.jpasia.aedew.com/upload/img/1380522648.jpg\" style=\"width: 488px; height: 261px;\" /></p>\r\n','','dir',1,3,'2013-04-07 22:05:32',1,'',0,1,1,'title','a:0:{}'),(6,'Standard Threaded','<p>\r\n	<img alt=\"\" src=\"http://json.jpasia.aedew.com/upload/img/1370323486.jpg\" style=\"width: 488px; height: 261px;\" /></p>\r\n','','dir',1,51,'2013-04-07 22:07:29',2,'',0,1,1,'title','a:0:{}'),(7,'WHO WE ARE','','<div style=\"padding: 50px 250px;\">\r\n	<img alt=\"\" src=\"http://json.jpasia.aedew.com/upload/img/1417769479.jpg\" style=\"margin: 0px 10px 10px 0px; width: 600px; height: 543px; float: left; display: block;\" />\r\n	<p>\r\n		<span style=\"font-size:12px;\">Tange Seiki has a long and storied history in the bicycle industry.&nbsp; Yosujirou Tange founded Tange Tekkousho (Tange Iron Works) in 1920 to produce high end front forks.&nbsp; In 1957, Tange Tekkousho changed its name to Tange Tekko and continued to produce high end steel and eventually alloy front forks.&nbsp; In 1974 Tange Tekko began developing and producing other high end parts and frame components.</span></p>\r\n	<p>\r\n		<span style=\"font-size:12px;\">In 1979, Michiaki Tange, one of Yosujirou Tange&rsquo;s sons, formed Tange Seiki Co. Ltd. in Osaka Japan and focused on making headsets and bottom brackets. Seiki means &ldquo;Precision Machining&rdquo; and that is exactly what Tange Seiki set out to do &ndash; producing headsets and bottom brackets to precise Japanese machining standards and the highest quality possible.&nbsp; Over the course of the next 34 years, Tange Seiki became known as one of the most innovative headset and bottom bracket brands in the world.&nbsp; Tange Seiki led the way in high quality headsets such as the Levin series, first produced in the 1980&rsquo;s and now have become popular once again with Fixie, Single Speed, and Retro bikes.&nbsp; In 1999 Tange Seiki invented the Zero Stack (semi-integrated) headsets which revolutionized the design of bicycles allowing them to be manufactured much lighter AND stronger at the same time.</span></p>\r\n	<p>\r\n		<span style=\"font-size:12px;\">Tange Seiki is a third generation company. Sato Tange, son of Tange Seiki&rsquo;s founder Michiaki Tange and Yosujirou Tange&rsquo;s grandson joined Tange Seiki in 1984 and became president in 2000. Sato&rsquo;s eldest son, Eisuke, nicknamed &ldquo;Ace&rdquo;, has joined the company and carries on Tange Seiki&rsquo;s commitment to Japanese excellence and standards.&nbsp; No matter where Tange Seiki products are manufactured, they are all made to the precise Japanese standard.&nbsp; This philosophy, to produce the highest quality parts to the highest standards, has been passed from one generation to another and will continue to guide Tange Seiki for generations to come.</span></p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n','file',1,1,'2013-04-08 02:52:13',2,'',0,1,1,'file','a:0:{}'),(8,'CONTACT','','<div style=\"padding: 50px 250px 50px 50px; width: 100%;\">\r\n	<img alt=\"\" src=\"http://json.jpasia.aedew.com/upload/img/1371459237.jpg\" style=\"display: block; float: left; margin: 0px 30px 0px 200px; width: 551px; height: 492px;\" />\r\n	<div style=\"float: left; width: 420px;\">\r\n		<a href=\"mailto:tangetw@ms16.hinet.net\"><img alt=\"\" src=\"http://json.jpasia.aedew.com/upload/img/1372148832.jpg\" style=\"width: 331px; height: 38px;\" /></a></div>\r\n	<p>\r\n		&nbsp;</p>\r\n	<div style=\"float: left; width: 420px;\">\r\n		<div style=\"float: left; width: 520px;\">\r\n			<div>\r\n				<span style=\"font-size: 14px;\"><span style=\"font-size: 16px;\"><strong>TANGE SEIKI CO., LTD</strong></span></span></div>\r\n			<div>\r\n				<span style=\"color: rgb(128, 128, 128); font-size: 14px;\">1-1-26, Kurumano-cho Nishi, Sakai-ku,</span></div>\r\n		</div>\r\n		<div style=\"float: left; width: 420px;\">\r\n			<div>\r\n				<span style=\"color: rgb(128, 128, 128);\"><span style=\"font-size: 14px;\">Sakai, Osaka, Japan 590-0940</span></span></div>\r\n			<div>\r\n				<span style=\"color: rgb(128, 128, 128);\"><span style=\"font-size: 14px;\">TEL:+81-72-224-9990<br />\r\n				FAX:+81-72-224-9991</span></span></div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				<strong><span style=\"font-size: 16px;\">TANGE SEIKI TAICHUNG CO.,LTD.</span></strong></div>\r\n			<div>\r\n				<span style=\"color: rgb(128, 128, 128